import React, { useState, useEffect, useCallback } from "react";
import { Link } from "react-router-dom";

export default function VideoCarousel() {
  const [videos, setVideos] = useState([]);

  useEffect(() => {
    const fetchLatestVideos = async () => {
      try {
        const apiKey = process.env.REACT_APP_YT_API_KEY;
        const channelId = process.env.REACT_APP_CHANNEL_ID;

        if (!apiKey || !channelId) {
          console.error("Missing YouTube API key or Channel ID");
          return;
        }

        /* 1Ô∏è‚É£ SEARCH API ‚Äî newest first (THIS IS CRITICAL) */
        const searchRes = await fetch(
          `https://www.googleapis.com/youtube/v3/search?part=snippet&channelId=${channelId}&maxResults=10&order=date&type=video&key=${apiKey}`
        );
        const searchData = await searchRes.json();

        if (!searchData.items?.length) {
          console.warn("No videos returned from search API");
          return;
        }

        const videoIds = searchData.items.map(
          (item) => item.id.videoId
        );

        /* 2Ô∏è‚É£ Fetch details to filter Shorts & live */
        const detailsRes = await fetch(
          `https://www.googleapis.com/youtube/v3/videos?part=contentDetails,snippet&id=${videoIds.join(
            ","
          )}&key=${apiKey}`
        );
        const detailsData = await detailsRes.json();

        if (!detailsData.items?.length) {
          console.warn("No video details returned");
          return;
        }

        /* 3Ô∏è‚É£ Filter out Shorts (< 60s) & live videos */
        const filtered = detailsData.items.filter((v) => {
          if (v.snippet.liveBroadcastContent !== "none") return false;

          const duration = v.contentDetails.duration;
          const h = parseInt(duration.match(/(\d+)H/)?.[1] || 0);
          const m = parseInt(duration.match(/(\d+)M/)?.[1] || 0);
          const s = parseInt(duration.match(/(\d+)S/)?.[1] || 0);

          return h * 3600 + m * 60 + s > 60;
        });

        /* 4Ô∏è‚É£ Take ONLY latest 3 */
        const latestThree = filtered.slice(0, 3).map((v) => v.id);

        setVideos(latestThree);
      } catch (err) {
        console.error("YouTube API error:", err);
      }
    };

    fetchLatestVideos();
  }, []);

  /* üö´ If API returns nothing, don‚Äôt render carousel */
  if (videos.length === 0) return null;

  /* ================= Carousel Logic (unchanged) ================= */

  const slides = [videos[videos.length - 1], ...videos, videos[0]];

  const [index, setIndex] = useState(1);
  const [speed, setSpeed] = useState(".6s");

  const next = useCallback(() => setIndex((i) => i + 1), []);
  const prev = () => setIndex((i) => i - 1);

  useEffect(() => {
    const timer = setInterval(next, 4500);
    return () => clearInterval(timer);
  }, [next]);

  useEffect(() => {
    if (index === slides.length - 1) {
      setTimeout(() => {
        setSpeed("0s");
        setIndex(1);
        setTimeout(() => setSpeed(".6s"), 20);
      }, 600);
    }

    if (index === 0) {
      setTimeout(() => {
        setSpeed("0s");
        setIndex(slides.length - 2);
        setTimeout(() => setSpeed(".6s"), 20);
      }, 600);
    }
  }, [index, slides.length]);

  return (
    <section className="carousel-section">
      <h2 className="carousel-title" style={{ fontWeight: "bold" }}>
        Latest Videos
      </h2>

      <div className="simple-carousel">
        <button className="nav left" onClick={prev}>‚ùÆ</button>

        <div className="track-wrapper">
          <div
            className="track"
            style={{
              transform: `translateX(-${index * 100}%)`,
              transition: speed,
            }}
          >
            {slides.map((id, i) => (
              <div className="slide" key={i}>
                <Link to={`/videos/${id}`} className="thumb-link">
                  <img
                    src={`https://img.youtube.com/vi/${id}/hqdefault.jpg`}
                    alt="video thumbnail"
                    className="thumb-img"
                  />
                  <span className="play-overlay">‚ñ∂</span>
                </Link>
              </div>
            ))}
          </div>
        </div>

        <button className="nav right" onClick={next}>‚ùØ</button>
      </div>
    </section>
  );
}
